    //暴力法
    public int lengthOfLongestSubstring1(String s) {
        String result = "";
        String a = "";
        for (int i = 0; i < s.length(); i++) {
            a = "" + s.charAt(i);
            if (result.length() == 0) {
                result = String.valueOf(s.charAt(i));
            }

            for (int j = i + 1; j < s.length(); j++) {
                if (isContain1(a, s.charAt(j))) {//
                    break;
                } else {
                    a = a + s.charAt(j);
                    if (a.length() > result.length()) {
                        result = a;
                    }
                }
            }
        }

        return result.length();
    }

    private boolean isContain1(String a, char c) {
        Set<Character> set = new HashSet<>();
        for (int i = 0; i < a.length(); i++) {
            set.add(a.charAt(i));
        }
        if (set.contains(c)) {
            return true;
        }
        return false;
    }

    public int lengthOfLongestSubstring(String s) {
        int n = s.length();
        int ans = 0;
        for (int i = 0; i < n; i++)
            for (int j = i + 1; j <= n; j++)
                if (allUnique(s, i, j)) ans = Math.max(ans, j - i);
        return ans;
    }

    //判断字符串是否是不含重复字符的
    public boolean allUnique(String s, int start, int end) {
        Set<Character> set = new HashSet<>();
        for (int i = start; i < end; i++) {
            Character ch = s.charAt(i);
            if (set.contains(ch)) return false;
            set.add(ch);
        }
        return true;
    }

    //减少复杂度的方法
    public int lengthOfLongestSubstring3(String s) {
        int n = s.length();
        Set<Character> set = new HashSet<>();//移动窗口
        int i = 0, j = 0, ans = 0;
        while (i < n && j < n) {
            if (!set.contains(s.charAt(j))) {//set中一直不包含重复的,j碰到重复的,将i的位置提前到被重复符号的位置
                set.add(s.charAt(j++));
                ans = Math.max(ans, j - i);
            } else {
                set.remove(s.charAt(i++));//窗口滑动的位置指示从原来左边的下标++1
            }
        }
        return ans;
    }

    //针对3的优化,i一次找到位置
    public int lengthOfLongestSubstring4(String s) {
        int n = s.length(), ans = 0;
        Map<Character, Integer> map = new HashMap<>(); // current index of character
        // try to extend the range [i, j]
        for (int j = 0, i = 0; j < n; j++) {
            if (map.containsKey(s.charAt(j))) {
                i = Math.max(map.get(s.charAt(j)), i);//包含了,则要重新计算i的下标       **优化点:一步滑动左边下标到和现在右边字符相同的位置
            }
            ans = Math.max(ans, j - i + 1);//
            map.put(s.charAt(j), j + 1);//j的字符覆盖前面的
        }
        return ans;
    }

    //独立却ASCII 128,其实还是lengthOfLongestSubstring4的方法,只是map用ascii数组代替
    @Test
    public void lengthOfLongestSubstring5() {
        String s="abcdeafghijklmnopqrstuvwxyz";
        int n = s.length(), ans = 0;
        int[] index = new int[128]; // current index of character,'A'==index[65],index[65]记录了字符串中'A'出现的位置,
        // try to extend the range [i, j]
        for (int j = 0, i = 0; j < n; j++) {
            if(s.charAt(j)=='a'){
                System.out.println("look");
            }
            i = Math.max(index[s.charAt(j)], i);//s.charAt(j)字符,字符的index[ASCII] ,第一次i不动,如果重复,提前提前到该位置
            ans = Math.max(ans, j - i + 1);
            index[s.charAt(j)] = j + 1;//赋予位置
        }
        System.out.println(ans);
//        return ans;
    }

